PyObject *JM_BinFromBuffer(fz_context *ctx, fz_buffer *buffer)
{
    PyObject *bytes = PyBytes_FromString("");
    if (buffer)
    {
        char *c = NULL;
        size_t len = fz_buffer_storage(gctx, buffer, &c);
        bytes = PyBytes_FromStringAndSize(c, (Py_ssize_t) len);
    }
    return bytes;
}

